import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import DBContextProvider from './DBContext';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <DBContextProvider>
      <App />
    </DBContextProvider>
  </React.StrictMode>
);
